import Avatar from '@material-ui/core/Avatar';
import React from 'react';
import style from '../userInfo.module.css';

type AvatarParams = {
    src: string
};
export const AvatarUser = (props: AvatarParams) => {
    return (
        <Avatar className={style.img} alt="Remy Sharp"
                src={props.src}/>
    );
};
